import React from 'react';
import './styles.css';
import { ReactComponent as TwitterSVG } from '../assets/icons/twitter.svg';
import { ReactComponent as GithubSVG } from '../assets/icons/github.svg';
import { ReactComponent as LinkedinSVG } from '../assets/icons/linkedin.svg';

const svg = { width: "70px", height: "70px" }

export default function Contact() {
    return (
        <div className="Body bg-dark p-5">
            <div >
                <div className="container-fluid justify-content-end">
                    <svg style={svg}> <TwitterSVG /> </svg>
                    <svg style={svg}> <LinkedinSVG /> </svg>
                    <svg style={svg}> <GithubSVG /></svg>
                </div>
                <h4 className="text-light">Nikolaj Johannes Skole Jensen</h4>
                <h6 className="text-light">nikolajjsj@gmail.com</h6>
                <h6 className="text-light">nikolaj.app.dev@gmail.com</h6>
            </div>
        </div>
    )
}
